import React from 'react';
import FilterCheckBox from '../FilterCheckbox/FilterCheckbox.jsx';
import styles from './SearchForm.module.css'; // Import CSS module

function SearchForm() {
  return (
    <section className={styles["search__container"]}>
      <div className={styles.search__container}>
        <form
          className={styles.search__form}
          name="search"
          autoComplete="off"
          onSubmit={(e) => e.preventDefault()}
          noValidate
        >
          <div className={styles.search__wrapper}>
            <i className={styles.search__icon} />
            <input
              className={styles.search__input}
              name="search"
              type="search"
              placeholder='Фильм'
              value='' // Можно оставить пустым или задать начальное значение
            />
            <div className={styles.search__toolbox}>
              <button
                className={styles.search__button}
                type="submit"
                aria-label="search-button"
              />
              <FilterCheckBox />
            </div>
          </div>
        </form>
      </div>
    </section>
  );
}

export default SearchForm;
